const Credit = () => {
    return (
        <>
            <div class="description">
                <h2>Кредит</h2>
                <p>Залезть в долговую яму стало проще! Кредитные консультанты придут вам на помощь.</p>
                <a class="btn" href="oip">Отправить заявку</a>
            </div>
            <img src="HTML%20Academy%20%D0%A2%D0%B5%D1%85%D0%BD%D0%BE%D0%BC%D0%B0%D1%80%D1%82_files/credit-service-img.png" width="465" height="285" alt="Кредит" />
        </>
    )
}

export default Credit
